measurements.description:
Twenty-five slightly cupped flowers and 17 buds on four up to 15.5-cm inflorescences; 

 sepals ovate, white, overlaid light pink blotches and spots, light gold bars basally, light gold blush apically;
 petals elliptical, white, overlaid light pink blotches and spots, light gold bars basally, light gold blush apically;
 lip saccate, white, overlaid light gold, side lobes gold; 
 column and anther cap white;

 substance firm; texture crystalline.
